import React from 'react';
import '../../styles/Project.css';

const styles = {
  div: {
    margin: "20px",
    padding: "10px",
  },
  headingStyle: {
    fontSize: '100px',
  },
};

export default function Portfolio() {
  return (
    <div>
      <h1 style={styles.headingStyle}>portfolio</h1>
      <div className="projects">
      <a href="https://jstndhouk.github.io/Lazy-Layover/" target="blank" className="projectTile"><img src="../../../../images/lazy-layover-homepage.PNG" className="img-fluid" alt="Lazy Layover Home Page"></img></a>
      <a href="https://cormillionaire.github.io/Weather-Dashboard/" target="blank" className="projectTile"><img src="../../../../images/KittensPlaying.jpg" className="img-fluid projectImage" alt="..."></img></a>
      <a href="https://wish-list-fscg.herokuapp.com/" target="blank" className="projectImage"><img src="../../../../images/portfolio-mobile.PNG" className="img-fluid projectImage" alt="..."></img></a>
      <a href="https://github.com/cormillionaire/ECommerceBackend" target="blank" className="projectImage"><img src="..." className="img-fluid projectImage" alt="..."></img></a>
      </div>
    </div>
  );
}
